import React from 'react';
import SecondaryHeader from '../Shared/SecondaryHeader';
import Project from '../Projects/Project';
import Footer from '../Shared/Footer';

const Projects = () => {
    return (
        <div>

            <h1>Projects</h1>
            <h1>2021</h1>
            <Project 
                name="React Portfolio Website"
                description="Personal site to display skills, as well as discuss computer science topics."
            />
            <Project 
                name="Face Mask Detector"
                description="A library and command line utility for detecting face masks in images and video streams."
            />
            <h1>2020</h1>
            <Project 
                name="Patient Management System"
                description="System to keep track of defibrillator patients billing information."
            />
            <Project 
                name="War Game"
                description="Object-oriented implementation of the card game War, with three different variations to play. Each game is simulated between two computers."
            />
        </div>  
    );
};

export default Projects;
